syntax = "proto3";

option csharp_namespace = "gRPCServer";

package greet;

// The greeting service definition.
service Greeter {
  // Sends a greeting
  rpc SayHelloUnary (HelloRequest) returns (HelloReply);
}

// The request message containing the user's name.
message HelloRequest {
  string name = 1;
}

// The response message containing the greetings.
message HelloReply {
  string message = 1;
}

syntax = "proto3";

option csharp_namespace = "gRPCServer.Weather";

package weather;

// The weather service definition.
service WeatherService {
  // Sends a greeting
  rpc CurrentWeatherUnary (WeatherForCityRequest) returns (WeatherResponse);
}

// The request message for weather.
message WeatherForCityRequest {
  string city = 1;
  enum Units {
    standard = 0;
    metric = 1;
    imperial = 2;
  }
  Units unit = 2;
}

// The response message for weather.
message WeatherResponse {
  double temperature = 1;
  double feels_like = 2;
}

syntax = "proto3";

option csharp_namespace = "gRPCServer.Weather";
import "google/protobuf/timestamp.proto";

package weather;

// The weather service definition.
service WeatherService {
  // Sends a current weather report
  rpc CurrentWeatherUnary (WeatherForCityRequest) returns (WeatherResponse);

  // Sends a current weather report
  rpc CurrentWeatherStream (WeatherForCityRequest) returns (stream WeatherResponse);
}

// The request message for weather.
message WeatherForCityRequest {
  string city = 1;
  enum Units {
    standard = 0;
    metric = 1;
    imperial = 2;
  }
  Units unit = 2;
}

// The response message for weather.
message WeatherResponse {
  double temperature = 1;
  double feels_like = 2;
  google.protobuf.Timestamp timestamp = 3;
}

syntax = "proto3";

